import "./App.css";
import "./component/allLogin.css";
import React, { Suspense, lazy } from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";

const Home = lazy(() => import("./component/HomePage/Home"));
const PassBook = lazy(() => import("./component/PassBookPage/PassBook"));
const ProductFlow = lazy(() =>
  import("./component/ProductFlowP1Page/ProductFlow")
);
const Imagepicker = lazy(() => import("./component/Imagepicker/Imagepicker"));
const Product = lazy(() => import("./component/ProductsPage/Product"));
const Otp = lazy(() => import("./component/OtpPage/Otp"));
const LoginInfo = lazy(() => import("./component/LoginInfoPage/LoginInfo"));
const LoginScreen = lazy(() =>
  import("./component/LoginScreenPage/LoginScreen")
);
const ErrorPage = lazy(() => import("./component/ErrorPage/Error"));

// import Home from "./component/HomePage/Home";
// import PassBook from "./component/PassBookPage/PassBook";
// import ProductFlow from "./component/ProductFlowP1Page/ProductFlow";
// import Imagepicker from "./component/Imagepicker/Imagepicker";
// import Product from "./component/ProductsPage/Product";
// import Otp from "./component/OtpPage/Otp";
// import "slick-carousel/slick/slick.css";
// import "slick-carousel/slick/slick-theme.css";
// import LoginInfo from "./component/LoginInfoPage/LoginInfo";
// import LoginScreen from "./component/LoginScreenPage/LoginScreen";
// import Error from "./component/ErrorPage/Error";

function App() {
  return (
    <div>
      <Router>
        <Suspense fallback="Loading..">
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/" element={<Home />} />
            <Route path="/loginScreen" element={<LoginScreen />} />
            <Route path="/login" element={<LoginInfo />} />
            <Route path="/otplogin" element={<Otp />} />
            {/* <Route path='/pixetra' /> */}
            {/* <Route path='/productsState' element={<ProductState />} /> */}
            <Route path="/products" element={<Product />} />
            <Route path="/product-name" element={<ProductFlow />} />
            <Route path="/pick-image" element={<Imagepicker />} />
            <Route path="/passbook" element={<PassBook />} />
            <Route path="*" element={<ErrorPage />} />
          </Routes>
        </Suspense>
      </Router>
    </div>
  );
}

export default App;
